import './profiletable.css';
import { DownOutlined } from '@ant-design/icons';
import { Link } from 'react-router-dom';
import { Dropdown, Space } from 'antd';
import { useState, useEffect } from 'react';

const ProfileTable = ({ userType }) => {
  const [submitType, setSubmitType] = useState('');
  const [usernames, setUsernames] = useState([]);
  const [registerdates, setRegisterdates] = useState([]);

  const handleInputChange = () => {
    if (userType === 'Buyers') setSubmitType('buyer');
    else if (userType === 'Sellers') setSubmitType('seller');
    else if (userType === 'Real Estate Agents') setSubmitType('REA');
    else setSubmitType(userType);
  };

  useEffect(() => {
    handleInputChange();
  }, []); // Run once on component mount to set the submitType

  useEffect(() => {
    fetchUsernames(); // Fetch data when component mounts
  }, []);

  const fetchUsernames = async () => {
    try {
      // Make API call to fetch user account data
      const response = await fetch('http://127.0.0.1:5000/api/login');
      if (!response.ok) {
        throw new Error('Failed to fetch user data');
      }
      const userData = await response.json();
      // Extract usernames from the fetched data
      const fetchedUsernames = userData.map(user => user.username);
      // Update state with the fetched usernames
      setUsernames(fetchedUsernames);
    } catch (error) {
      console.error('Error fetching user data:', error);
    }
  };

  return (
    <>
      <div className="tableOfProfiles">
        <h2>
          {userType}{' '}
          <Link to={`/sacreateaccountpage/${submitType}`}>
            <button className="PTCreateAccButton">+</button>
          </Link>
        </h2>
        <table className="profilesTable">
          <thead>
            <tr>
              <th className="profileTableColumn1">Username</th>
              <th className="profileTableColumn2">Register Date</th>
              <th className="profileTableColumn3">Status</th>
              <th className="profileTableColumn4">Actions</th>
            </tr>
          </thead>
          <td colSpan={4}>
            <hr className="hr2px" />
          </td>
          <tbody>
            {usernames.map((username, index) => (
              <tr key={index}>
                <td>{username}</td>
                <td>{registerdate}</td>
                <td>{status}</td>
                <td>
                  {/* Link to the profile page with the username as a URL parameter */}
                  <Link to={`/viewprofile/${username}`}>View Profile</Link>
                </td>
              </tr>
        ))}
      </tbody>
          <tr>
            <td>Account1 Name</td>
            <td>23/04/2024</td>
            <td>Active</td>
            <td>
              <Dropdown menu={{ items }}>
                <a onClick={(e) => e.preventDefault()}>
                  <Space>
                    Hover me <DownOutlined />
                  </Space>
                </a>
              </Dropdown>
            </td>
          </tr>
          <td colSpan={4}>
            <hr className="hr1px" />
          </td>
        </table>
      </div>
    </>
  );
};

const items = [
  {
    key: '1',
    label: (
      <Link to={`/profilepage/${username}`}>
        View account
      </Link>
    ),
    disabled: false,
  },
  {
    key: '2',
    label: (
      <a target="_blank" rel="noopener noreferrer" href="https://www.aliyun.com">
        Update account
      </a>
    ),
    disabled: false,
  },
  {
    key: '3',
    label: (
      <a target="_blank" rel="noopener noreferrer" href="https://www.luohanacademy.com">
        Suspend account
      </a>
    ),
    disabled: false,
  },
  {
    key: '4',
    label: (
      <a target="_blank" rel="noopener noreferrer" href="https://www.luohanacademy.com">
        Reactivate account (disabled)
      </a>
    ),
    disabled: true,
  },
  {
    key: '5',
    danger: true,
    label: 'Delete account',
  },
];

export default ProfileTable;
